function autoResizeProductName() {
	var screenWidth = $(window).width();
	var selectorFirst = '.product-info .product_bg .product-details h2';
	var selectorSecond = '.bs-product-info .product-title';
	var itemInRow = 2;
	if(screenWidth > 978){
		itemInRow = 3;
	}
	var divs = $(".name-auto-resize");
	for(var i = 0; i < divs.length; i+=itemInRow) {
		var groupDivs = divs.slice(i, i+itemInRow);
		var maxHeightOfName = 0;
		console.log("new group");
		$(groupDivs).each(function(key, val){
			var _selctor = $(val).find(selectorFirst);
			if(_selctor.length < 1){
				_selctor = $(val).find(selectorSecond);
			}
			var individualHeight = _selctor.outerHeight();
			// console.log($(val).attr('id') + ' : ' + individualHeight);
			if(individualHeight > maxHeightOfName) {
				maxHeightOfName = individualHeight;
			}
		});
		$(groupDivs).each(function(key, val){
			var _selctor = $(val).find(selectorFirst);
			if(_selctor.length < 1){
				_selctor = $(val).find(selectorSecond);
			}
			_selctor.height(maxHeightOfName + 'px');
		});
	}
}

  function createImageListByAjax(productUrl, handleData) {
		jQuery.getJSON(productUrl + '.js', function(product) {
			var html = '';
			jQuery.each(product.images, function(key, val){
				if(key != 0 && key != 1){
					html += '<a href="'+productUrl+'"><img src="'+val+'" alt="'+product.title+'" title="'+product.title+'" /></a>';
				}
			});
			handleData(html);
		});
	}

